--
-- Extraindo dados da tabela `perguntas_biologia`
--

INSERT INTO `perguntas_biologia` (`id`, `edicaoEnem`, `enunciado`, `imagem`, `referencia`, `texto`, `texto2`, `referencia2`, `conteudo`, `pergunta`, `resposta`, `A`, `B`, `C`, `D`, `E`, `reg_date`) VALUES
(1, '<b>ENEM 2014 2ª APLICAÇÃO</b>', 'Determinado bioma brasileiro apresenta vegetação conhecida por perder as folhas e ficar apenas com galhos esbranquiçados, ao passar por até nove meses na seca. As plantas podem acumular água no caule e na raiz, além de apresentarem folhas pequenas, que em algumas espécies assumem a forma de espinhos.', NULL, NULL, NULL, NULL, NULL, 'Ecologia', 'Qual região fitogeográfica brasileira apresenta plantas com essas características?', 'B', 'Cerrado.', 'Caatinga.', 'Floresta Amazônica.', 'Pantanal.', 'Mata Atlântica.', '2022-01-21 15:10:32'),
(2, '<b>ENEM 2018 1ª APLICAÇÃO</b>', 'Corredores ecológicos visam mitigar os efeitos da fragmentação dos ecossistemas promovendo a ligação entre diferentes áreas, com o objetivo de proporcionar o deslocamento de animais, a dispersão de sementes e o aumento da cobertura vegetal. São instituídos com base em informações como estudos sobre o deslocamento de espécies, sua área de vida (área necessária para o suprimento de suas necessidades vitais e reprodutivas) e a distribuição de suas populações.', NULL, 'www.mma.gov.br. Acesso em 30 mar. 2017 (adaptado).', NULL, NULL, NULL, 'Ecologia', 'Nessa estratégia, a recuperação da biodiversidade é efetiva porque', 'A', 'propicia o fluxo gênico.', 'intensifica o manejo de espécies.', 'amplia o processo de ocupação humana.', 'aumenta o número de indivíduos nas populações.', 'favorece a formação de ilhas de proteção integral.', '2022-01-21 15:10:45'),
(3, '<b>ENEM 2018 1ª APLICAÇÃO</b>', 'O deserto é um bioma que se localiza em regiões de pouca umidade. A fauna é, predominantemente, composta por animais roedores, aves, répteis e artrópodes.', NULL, NULL, NULL, NULL, NULL, 'Ecologia', 'Uma adaptação, associada a esse bioma, presente nos seres vivos dos grupos citados é o(a):', 'B', 'existência de numerosas glândulas sudoríparas na epiderme.', 'eliminação de excretas nitrogenadas de forma concentrada.', 'desenvolvimento do embrião no interior de ovo com casca.', 'capacidade de controlar a temperatura corporal.', 'respiração realizada por pulmões foliáceos.', '2022-01-21 15:10:58'),
(4, '<b>ENEM 2017 LIBRAS</b>', 'Os manguezais são considerados um ecossistema costeiro de transição, pois são terrestres e estão localizados no encontro das águas dos rios com o mar. Estão sujeitos ao regime das marés e são dominados por espécies vegetais típicas, que conseguem se desenvolver nesse ambiente de elevada salinidade. Nos manguezais, é comum observar raízes suporte, que ajudam na sustentação em função do solo lodoso, bem como raízes crescem verticalmente do solo (geotropismo negativo).', NULL, 'https://vivimarc.sites.uol.com.br. Acesso em: 20 fev. 2012 (adaptado).', NULL, NULL, NULL, 'Ecologia', 'Essas últimas raízes citadas desenvolvem estruturas em sua porção aérea relacionadas à: ', 'C', 'flutuação.', 'transpiração.', 'troca gasosa.', 'excreção de sal.', 'absorção de nutrientes.', '2022-01-21 15:11:11'),
(5, '<b>ENEM 2019 2ª APLICAÇÃO</b>', 'Algumas espécies de orquídeas apresentam flores que mimetizam vespas fêmeas, de forma que vespas machos são atraídas na tentativa de acasalamento. Ao chegarem às flores, os machos frequentemente entram em contato com o pólen da flor, sem prejuízo de suas atividades. Contudo, como não conseguem se acasalar, esses machos procuram novas fêmeas, podendo encontrar novas flores e polinizá-las.', NULL, NULL, NULL, NULL, NULL, 'Ecologia', 'Essa interação ecológica pode ser classificada como:', 'A', 'comensalismo.', 'amensalismo.', 'mutualismo.', 'parasitismo.', 'simbiose.', '2022-01-21 15:11:23'),
(6, '<b>ENEM 2013 1ª APLICAÇÃO</b>', 'No Brasil, cerca de 80% da energia elétrica advém de hidrelétricas, cuja construção implica o represamento de rios. A formação de um reservatório para esse fim, por sua vez, pode modificar a ictiofauna local. Um exemplo é o represamento do Rio Paraná, onde se observou o desaparecimento de peixes cascudos quase que simultaneamente ao aumento do número de peixes de espécies exóticas introduzidas, como o mapará e a corvina, as três espécies com nichos ecológicos semelhantes.', NULL, 'PETESSE, M. L.; PETRERE JR., M. Ciência Hoje, São Paulo, n. 293, v. 49, jun. 2012.', NULL, NULL, NULL, 'Ecologia', 'Nessa modificação da ictiofauna, o desaparecimento de cascudos é explicado pelo(a):', 'B', 'extinção de nichos ecológicos.', 'aumento da competição interespecífica.', 'diminuição da competição intraespecífica.', 'redução do fluxo gênico da espécie nativa.', 'isolamento geográfico dos peixes.', '2022-01-21 15:11:36'),
(7, '<b>ENEM 2014 1ª APLICAÇÃO</b>', 'A aplicação excessiva de fertilizantes nitrogenados na agricultura pode acarretar alterações no solo e na água pelo acúmulo de compostos nitrogenados, principalmente a forma mais oxidada, favorecendo a proliferação de algas e plantas aquáticas e alterando o ciclo do nitrogênio, representado no esquema. A espécie nitrogenada mais oxidada tem sua quantidade controlada por ação de microrganismos que promovem a reação de redução dessa espécie, no processo denominado desnitrificação.', , NULL, NULL, NULL, NULL, 'Ecologia', 'O processo citado está representado na etapa:', 'E', 'I', 'II', 'III', 'IV', 'V', '2022-01-21 15:11:46'),
(8, '<b>ENEM 2016 1ª APLICAÇÃO</b>', 'Ao percorrer o trajeto de uma cadeia alimentar, o carbono, elemento essencial e majoritário da matéria orgânica que compõe os indivíduos, ora se encontra em sua forma inorgânica, ora se encontra em sua forma orgânica. Em uma cadeia alimentar composta por fitoplâncton, zooplâncton, moluscos, crustáceos e peixes ocorre a transição desse elemento da forma inorgânica para a orgânica.', NULL, NULL, NULL, NULL, NULL, 'Ecologia', 'Em qual grupo de organismos ocorre essa transição?', 'A', 'Fitoplâncton.', 'Zooplâncton.', 'Moluscos.', 'Crustáceos.', 'Peixes.', '2022-01-21 15:11:55'),
(9, '<b>ENEM 2013 1ª APLICAÇÃO</b>', 'Estudos de fluxo de energia em ecossistemas demonstram que a alta produtividade nos manguezais está diretamente relacionada às taxas de produção primária líquida e à rápida reciclagem dos nutrientes. Como exemplo de seres vivos encontrados nesse ambiente, temos: aves, caranguejos, insetos, peixes e algas.', NULL, NULL, NULL, NULL, NULL, 'Ecologia', 'Dos grupos de seres vivos citados, os que contribuem diretamente para a manutenção dessa produtividade no referido ecossistema são:', 'D', 'insetos.', 'caranguejos.', 'peixes.', 'algas.', 'aves.', '2022-01-21 15:12:06'),
(10, '<b>ENEM 2019 1ª APLICAÇÃO</b>', 'Um alimento orgânico deve apresentar em sua embalagem o selo de uma instituição\r\ncertificadora, garantindo ao consumidor que, além de ser um alimento isento de agrotóxicos, também é produzido com técnicas planejadas e controladas. A técnica de produção desses alimentos causa menor impacto aos recursos naturais, contribuindo para melhorar a qualidade de vida das pessoas.', NULL, NULL, NULL, NULL, NULL, 'Ecologia', 'Nesse sistema de produção de alimentos vegetais, o controle de\r\ninsetos é manejado por meio do(a):', 'D', 'prática de adubação verde.', 'emprego da compostagem.', 'controle da irrigação do solo.', 'utilização de predadores naturais.', 'uso de sementes inoculadas com <i>Rhizobium</i>.', '2022-01-21 15:12:14');

