INSERT INTO `perguntas_fisica` (`id`, `edicaoEnem`, `enunciado`, `imagem`, `texto`, `texto2`, `referencia2`, `referencia`, `conteudo`, `pergunta`, `resposta`, `A`, `B`, `C`, `D`, `E`, `reg_date`) VALUES
(1, 'ENEM 2012 1ª APLICAÇÃO', 'Uma empresa de transportes precisa efetuar a entrega de uma encomenda o mais breve possível. Para tanto, a equipe de logística analisa o trajeto desde a empresa até o local da entrega. Ela verifica que o trajeto apresenta dois trechos de distâncias diferentes e velocidades máximas permitidas diferentes. No primeiro trecho, a velocidade máxima permitida é de 80 km/h e a distância a ser percorrida é de 80 km. No segundo trecho, cujo comprimento vale 60 km, a velocidade máxima permitida é 120 km/h.', NULL, '', '', '', NULL, 'Mecânica', 'Supondo que as condições de trânsito sejam favoráveis para que o veículo da empresa ande continuamente na velocidade máxima permitida, qual será o tempo necessário, em horas, para a realização da entrega?', 'D', '3,0.', '0,7.', '2,0.', '1,5.', '1,4.', '2022-01-15 15:45:53'),
(2, 'ENEM 2013 2ª APLICAÇÃO', 'Conta-se que um curioso incidente aconteceu durante a Primeira Guerra Mundial. Quando voava a uma altitude de dois mil metros, um piloto francês viu o que acreditava ser uma mosca parada perto de sua face. Apanhando-a rapidamente, ficou surpreso ao verificar que se tratava de um projétil alemão.', NULL, '', '', '', 'PERELMAN, J. Aprenda física brincando. São Paulo: Hemus, 1970.', 'Mecânica', 'O piloto consegue apanhar o projétil, pois:', 'A', 'o avião se movia no mesmo sentido que o dele, com velocidade de mesmo valor.', 'o avião se movia no mesmo sentido que o dele, com velocidade visivelmente superior.', 'o avião se movia no sentido oposto ao dele, com velocidade de mesmo valor.', 'ele foi disparado em direção ao avião francês, freado pelo ar e parou justamente na frente do piloto.', 'ele foi disparado para cima com velocidade constante, no instante em que o avião francês passou.', '2022-01-15 15:28:34');
INSERT INTO `perguntas_fisica` (`id`, `edicaoEnem`, `enunciado`, `imagem`, `texto`, `texto2`, `referencia2`, `referencia`, `conteudo`, `pergunta`, `resposta`, `A`, `B`, `C`, `D`, `E`, `reg_date`) VALUES
(3, 'ENEM 2017 LIBRAS', 'No Brasil, a quantidade de mortes decorrentes de acidentes por excesso de velocidade já é tratada como uma epidemia. Uma forma de profilaxia é a instalação de aparelhos que medem a velocidade dos automóveis e registram,\r\npor meio de fotografias, os veículos que trafegam acima do limite de velocidade permitido. O princípio de funcionamento desses aparelhos consiste na instalação de dois sensores no solo, de forma a registrar os instantes em que o veículo passa e, em caso de excesso de velocidade, fotografar o veículo quando ele passar sobre uma marca no solo, após o segundo sensor.\r\n\r\nConsidere que o dispositivo representado na figura esteja instalado em uma via com velocidade máxima permitida de 60 km/h.', , '', '', '', NULL, 'Mecânica', 'No caso de um automóvel que trafega na velocidade máxima permitida, o tempo, em milissegundos, medido pelo dispositivo, é:', 'C', '8,3.', '12,5.', '30.', '45.', '75.', '2022-01-15 15:45:26');
INSERT INTO `perguntas_fisica` (`id`, `edicaoEnem`, `enunciado`, `imagem`, `texto`, `texto2`, `referencia2`, `referencia`, `conteudo`, `pergunta`, `resposta`, `A`, `B`, `C`, `D`, `E`, `reg_date`) VALUES
(4, 'ENEM 2018 2ª APLICAÇÃO', 'Um piloto testa um carro em uma reta longa de um autódromo. A posição do carro nessa reta, em função do tempo, está representada no gráfico.', , '', '', '', NULL, 'Mecânica', 'Os pontos em que a velocidade do carro é menor e maior são, respectivamente:', 'C', 'K e M.', 'N e K.', 'M e L.', 'N e L.', 'N e M.', '2022-01-15 15:28:34');
INSERT INTO `perguntas_fisica` (`id`, `edicaoEnem`, `enunciado`, `imagem`, `texto`, `texto2`, `referencia2`, `referencia`, `conteudo`, `pergunta`, `resposta`, `A`, `B`, `C`, `D`, `E`, `reg_date`) VALUES
(5, 'ENEM 2019 1ª APLICAÇÃO', 'A agricultura de precisão reúne técnicas agrícolas que consideram particularidades locais do solo ou lavoura a fim de otimizar o uso de recursos. Uma das formas de adquirir informações sobre essas particularidades é a fotografia aérea de baixa altitude realizada por um veículo aéreo não tripulado (vant). Na fase de aquisição é importante determinar o nível de sobreposição entre as fotografias. A figura ilustra como uma sequência de imagens é coletada por um vant e como são formadas as sobreposições frontais.\r\n\r\nO operador do vant recebe uma encomenda na qual as imagens devem ter uma sobreposição frontal de 20% em um terreno plano. Para realizar a aquisição das imagens, seleciona uma altitude H fixa de voo de 1.000 m a uma velocidade constante de 50 ms<sup>-1</sup>. A abertura da câmera fotográfica do vant é de 90°. Considere tg (45°) = 1. ', , '', '', '', 'Natural Resources Canada. Concepts of Aerial Photography. www.nrcan.gc.ca.', 'Mecânica', 'Com que intervalo de tempo o operador deve adquirir duas imagens consecutivas?\r\n', 'B', '40 segundos.', '32 segundos.', '28 segundos.', '16 segundos.', '8 segundos.', '2022-01-15 15:44:56');
INSERT INTO `perguntas_fisica` (`id`, `edicaoEnem`, `enunciado`, `imagem`, `texto`, `texto2`, `referencia2`, `referencia`, `conteudo`, `pergunta`, `resposta`, `A`, `B`, `C`, `D`, `E`, `reg_date`) VALUES
(6, 'ENEM 2019 1ª APLICAÇÃO', 'Na madrugada de 11 de março de 1978, partes de um foguete soviético reentraram na atmosfera acima da cidade do Rio de Janeiro e caíram no Oceano Atlântico. Foi um belo espetáculo, os inúmeros fragmentos entrando em ignição devido ao atrito com a atmosfera brilharam intensamente, enquanto “cortavam o céu”. Mas se a reentrada tivesse acontecido alguns minutos depois, teríamos uma tragédia, pois a queda seria na área urbana do Rio de Janeiro e não no oceano.', , '', '', '', NULL, 'Mecânica', 'De acordo com os fatos relatados, a velocidade angular do foguete em relação à Terra no ponto de reentrada era:', 'B', 'igual à da Terra e no mesmo sentido. \r\n', 'superior à da Terra e no mesmo sentido.\r\n', 'inferior à da Terra e no sentido oposto.', 'igual à da Terra e no sentido oposto.', 'superior à da Terra e no sentido oposto.', '2022-01-15 15:28:34');
INSERT INTO `perguntas_fisica` (`id`, `edicaoEnem`, `enunciado`, `imagem`, `texto`, `texto2`, `referencia2`, `referencia`, `conteudo`, `pergunta`, `resposta`, `A`, `B`, `C`, `D`, `E`, `reg_date`) VALUES
(7, 'ENEM 2016 2ª APLICAÇÃO', 'Para um salto no Grand Canyon usando motos, dois paraquedistas vão utilizar uma moto cada, sendo que uma delas possui massa três vezes maior. Foram construídas duas pistas idênticas até a beira do precipício, de forma que no momento do salto as motos deixem a pista horizontalmente e ao mesmo tempo. No instante em que saltam, os paraquedistas abandonam suas motos e elas caem praticamente sem resistência do ar.', NULL, '', '', '', NULL, 'Mecânica', 'As motos atingem o solo simultaneamente porque :', 'D', 'possuem a mesma inércia.', 'estão sujeitas à mesma força resultante.', 'têm a mesma quantidade de movimento inicial.', 'adquirem a mesma aceleração durante a queda.', ' são lançadas com a mesma velocidade horizontal.', '2022-01-15 15:28:34'),
(8, 'ENEM 2012 2ª APLICAÇÃO', 'O freio ABS é um sistema que evita que as rodas de um automóvel sejam bloqueadas durante uma frenagem forte e entrem em derrapagem. Testes demonstram que, a partir de uma dada velocidade, a distância de frenagem será menor se for evitado o bloqueio das rodas.', NULL, '', '', '', NULL, 'Mecânica', 'O ganho na eficiência da frenagem na ausência de bloqueio das rodas resulta do fato de:', 'B', 'o coeficiente de atrito estático tornar-se igual ao dinâmico momentos antes da derrapagem.', 'o coeficiente de atrito estático ser maior que o dinâmico, independentemente da superfície de contato entre os pneus e o pavimento.', 'o coeficiente de atrito estático ser menor que o dinâmico, independentemente da superfície de contato entre os pneus e o pavimento.', 'a superfície de contato entre os pneus e o pavimento ser maior com as rodas desbloqueadas e o coeficiente de atrito estático ser maior que o dinâmico.', 'a superfície de contato entre os pneus e o pavimento ser maior com as rodas desbloqueadas, independentemente do coeficiente de atrito.', '2022-01-15 15:28:34'),
(9, 'ENEM 2013 1ª APLICAÇÃO', 'Uma pessoa necessita da força de atrito em seus pés para se deslocar sobre uma superfície. Logo, uma pessoa que sobe uma rampa em linha reta será auxiliada pela força de atrito exercida pelo chão em seus pés.\r\n', NULL, '', '', '', NULL, 'Mecânica', 'Em relação ao movimento dessa pessoa, quais são a direção e o sentido da força de atrito mencionada no texto?', 'C', 'Horizontal e no mesmo sentido do movimento.', 'Perpendicular ao plano e no mesmo sentido do movimento.', 'Paralelo ao plano e no mesmo sentido do movimento.', 'Paralelo ao plano e no sentido contrário ao movimento.', 'Vertical e sentido para cima.', '2022-01-15 15:44:11'),
(10, 'ENEM 2015 2ª APLICAÇÃO', 'Num sistema de freio convencional, as rodas do carro travam e os pneus derrapam no solo, caso a força exercida sobre o pedal seja muito intensa. O sistema ABS evita o travamento das rodas, mantendo a força de atrito no seu valor estático máximo, sem derrapagem. O coeficiente de atrito estático da borracha em contato com o concreto vale µ<sub>e</sub> = 1,0 e o coeficiente de atrito cinético para o mesmo par de materiais é µ<sub>c</sub> = 0,75. Dois carros, com velocidades iniciais iguais a 108 km/h, iniciam a frenagem numa estrada perfeitamente horizontal de concreto no mesmo ponto. O carro 1 tem sistema ABS e utiliza a força de atrito estática máxima para a frenagem; já o carro 2 trava as rodas, de maneira que a força de atrito efetiva é a cinética. Considere g = 10 m/s².', NULL, '', '', '', NULL, 'Mecânica', 'As distâncias, medidas a partir do ponto em que iniciam a frenagem, que os carros 1 (d<sub>1</sub>) e 2 (d<sub>2</sub>) percorrem até parar são, respectivamente,', 'A', 'd<sub>1</sub> = 90 m e d<sub>2</sub> = 120 m.', 'd<sub>1</sub> = 60 m e d<sub>2</sub> = 45 m.', 'd<sub>1</sub> = 45 m e d<sub>2</sub> = 60 m.', 'd<sub>1</sub> = 5,8×10<sup>2</sup> m e d<sub>2</sub> = 7,8×10<sup>2</sup> m.', 'd<sub>1</sub> = 7,8×10<sup>2</sup> m e d<sub>2</sub> = 5,8×10<sup>2</sup> m.', '2022-01-23 15:40:20');

