INSERT INTO `perguntas_literatura` (`id`, `edicaoEnem`, `enunciado`, `imagem`, `texto`, `texto2`, `referencia2`, `referencia`, `conteudo`, `pergunta`, `resposta`, `A`, `B`, `C`, `D`, `E`, `reg_date`) VALUES
(1, '<b>ENEM 2018 2ª APLICAÇÃO</b>', 'E fui mostrar ao ilustre hóspede [o governador do Estado] a serraria, o descaroçador e o estábulo. Expliquei em resumo a prensa, o dínamo, as serras e o banheiro carrapaticida. De repente supus que a escola poderia trazer a benevolência do governador para certos favores que eu tencionava solicitar.<br>\r\n— Pois sim senhor. Quando V. Exª. vier aqui outra vez, encontrará essa gente aprendendo cartilha.', NULL, NULL, NULL, NULL, 'RAMOS, G. São Bernardo. Rio de Janeiro: Record, 1991.', 'Produção republicana', 'O fragmento do romance de Graciliano Ramos dialoga com o contexto da Primeira República no Brasil, ao focalizar o(a):', 'E', 'derrocada de práticas clientelistas.', 'declínio do antigo atraso socioeconômico.', 'liberalismo desapartado de favores do Estado.', 'fortalecimento de políticas públicas educacionais.', 'aliança entre a elite agrária e os dirigentes políticos.', '2022-01-21 15:12:33'),
(2, '<b>ENEM 2017 2ª APLICAÇÃO</b>', 'Dois parlamentos\r\n<br>\r\nNestes cemitérios gerais<br>\r\nnão há morte pessoal.<br>\r\nNenhum morto se viu<br>\r\ncom modelo seu, especial.<br>\r\nVão todos com a morte padrão,<br>\r\nem série fabricada.<br>\r\nMorte que não se escolhe<br>\r\ne aqui é fornecida de graça.<br>\r\nQue acaba sempre por se impor<br>\r\nsobre a que já medrasse.<br>\r\nVence a que, mais pessoal,<br>\r\nalguém já trouxesse na carne.<br>\r\nMas afinal tem suas vantagens<br>\r\nEsta morte em série.<br>\r\nFaz defuntos funcionais,<br>\r\nPróprios a uma terra sem vermes.<br>', NULL, NULL, NULL, NULL, 'MELO NETO, J. C. Serial e antes. Rio de Janeiro: Nova Fronteira, 1997 (fragmento).', 'Produção republicana', 'A lida do sertanejo com suas adversidades constitui um viés temático muito presente em João Cabral de Melo Neto.', 'C', 'inutilidade de divisão social e hierárquica após a morte.', 'aspecto desumano do cemitérios da população carente.', 'nivelamento do anonimato imposto pela miséria na morte.', 'tom de ironia para com a fragilidade dos corpos e da terra.', 'indiferença do sertanejo com a ausência de seus próximos.', '2022-01-21 15:12:45'),
(3, '<b>ENEM 2017 1ª APLICAÇÃO</b>', 'O farrista\r\n<br>\r\nQuando o almirante Cabral<br>\r\nPôs as patas no Brasil<br>\r\nO anjo da guarda dos índios<br>\r\nEstava passeando em Paris.<br>\r\nQuando ele voltou de viagem<br>\r\nO holandês já está aqui.<br>\r\nO anjo respira alegre:<br>\r\n“Não faz mal, isto é boa gente,<br>\r\nVou arejar outra vez.”<br>\r\nO anjo transpôs a barra,<br>\r\nDiz adeus a Pernambuco,<br>\r\nFaz barulho, vuco-vuco,<br>\r\nTal e qual o zepelim<br>\r\nMas deu um vento no anjo,<br>\r\nEle perdeu a memória...<br>\r\nE não voltou nunca mais.<br>', NULL, NULL, NULL, NULL, 'MENDES. M. História do Brasil. Rio de Janeiro: Nova Fronteira. 1992', 'Produção republicana', 'A obra de Murilo Mendes situa-se na fase inicial do Modernismo, cujas propostas estéticas transparecem, no poema, por um eu lírico que:', 'B', 'configura um ideal de nacionalidade pela integração regional. \r\n', 'remonta ao colonialismo assente sob um viés iconoclasta. ', 'repercute as manifestações do sincretismo religioso.', 'descreve a gênese da formação do povo brasileiro.', 'promove inovações no repertório linguístico.', '2022-01-21 15:12:58');

