INSERT INTO `perguntas_matematica` (`id`, `edicaoEnem`, `enunciado`, `imagem`, `texto`, `texto2`, `referencia2`, `referencia`, `conteudo`, `pergunta`, `resposta`, `A`, `B`, `C`, `D`, `E`, `reg_date`) VALUES
(1, 'ENEM 2009 2ª APLICAÇÃO', 'A tabela a seguir mostra a evolução da população da região Nordeste do Brasil, em milhões de habitantes, em alguns anos entre o final do século XIX e o final do século XX.', , NULL, NULL, NULL, 'http://www.ibge.com.br/seculoxx/estatisticas_populacionais.shtm', 'Matemática básica', 'Utilizando-se uma escala decenal na qual o ano 1890 corresponde ao decênio 1, 1900 corresponde ao decênio 2, etc., então a população da região Nordeste ultrapassou os 30 milhões de habitantes após o decênio:', 'D', '6.', '7.', '8.', '9.', '10.', '2022-01-15 15:55:00');
INSERT INTO `perguntas_matematica` (`id`, `edicaoEnem`, `enunciado`, `imagem`, `texto`, `texto2`, `referencia2`, `referencia`, `conteudo`, `pergunta`, `resposta`, `A`, `B`, `C`, `D`, `E`, `reg_date`) VALUES
(2, 'ENEM 2018 1ª APLICAÇÃO', 'Um edifício tem a numeração dos andares iniciando no térreo (T), e continuando com primeiro, segundo, terceiro, … , até o último andar. Uma criança entrou no elevador e, tocando no painel, seguiu uma sequência de andares, parando, abrindo e fechando a porta em diversos andares. A partir de onde entrou a criança, o elevador subiu sete andares, em seguida desceu dez, desceu mais treze, subiu nove, desceu quatro e parou no quinto andar, finalizando a sequência. Considere que, no trajeto seguido pela criança, o elevador parou uma vez no último andar do edifício.', NULL, NULL, NULL, NULL, NULL, 'Matemática básica', 'De acordo com as informações dadas, o último andar do edifício é o:', 'C', '16°', '22°', '23°', '25°', '32°', '2022-01-15 20:06:42'),
(3, 'ENEM 2017 2ª APLICAÇÃO', 'Uma repartição pública possui um sistema que armazena em seu banco de dados todos os ofícios, memorandos e cartas enviados ao longo do anos. Para organizar todo esse material e facilitar a localização no sistema, o computador utilizado pela repartição gera um código para cada documento, de forma que os oito primeiros dígitos indicam a data em que o documento foi emitido (DDMMAAAA), os dois dígitos seguintes indicam o tipo de documento (ofício: 01, memorando: 02 e carta: 03) e o três últimos dígitos indicam a ordem do documento. Por exemplo, o código 0703201201003 indica um ofício emitido no dia 7 de março de 2012, cuja ordem é 003. No dia 27 de janeiro de 2001, essa repartição pública emitiu o memorando de ordem 012 e o enviou aos seus funcionários.', NULL, NULL, NULL, NULL, NULL, 'Matemática básica', 'O código gerado para esse memorando foi:', 'E', '0122701200102.', '0201227012001.', '0227012001012.', '2701200101202.', '2701200102012.', '2022-01-15 20:06:42'),
(4, 'ENEM 2017 LIBRAS', 'César Augusto Cielo Filho é um nadador brasileiro, campeão olímpico e detentor de várias medalhas nacionais e internacionais.\r\n\r\nEm 2013, no Campeonato Mundial de Barcelona, na Espanha, César Cielo obteve o primeiro lugar no estilo livre, nadando 50 metros em 21,320 segundos.', NULL, NULL, NULL, NULL, 'http://pt.wikipedia.org. Acesso em: 20 mar. 2014.', 'Matemática básica', 'A posição ocupada pelo algarismo 3 nesse registro de tempo corresponde a:', 'E', 'unidades de segundos.\r\n', 'milésimos de segundos.', 'centésimos de segundos.', 'centenas de segundos.', 'décimos de segundos.', '2022-01-15 20:12:32'),
(5, 'ENEM 2018 1ª APLICAÇÃO', 'Torneios de tênis, em geral, são disputados em sistema de eliminatória simples. Nesse sistema, são disputadas partidas entre dois competidores, com a eliminação do perdedor e promoção do vencedor para a fase seguinte. Dessa forma, se na 1ª fase o torneio conta com 2n competidores, então na 2ª fase restarão n competidores, e assim sucessivamente até a partida final.\r\n\r\nEm um torneio de tênis, disputado nesse sistema, participam 128 tenistas.', NULL, NULL, NULL, NULL, NULL, 'Matemática básica', 'Para se definir o campeão desse torneio, o número de partidas necessárias é dado por:', 'E', '2 x 128', '64 + 32 + 16 +8 + 4 + 2', '128 + 64 + 32 + 16 + 16 + 8 + 4 + 2 + 1', '128 + 64 + 32 + 16 + 16 + 8 + 4 + 2', '64 + 32 + 16 + 8 + 4 + 2 + 1', '2022-01-15 20:12:32'),
(6, 'ENEM 2018 2ª APLICAÇÃO', 'Alguns modelos de rádios automotivos estão protegidos por um código de segurança. Para ativar o sistema de áudio, deve-se digitar o código secreto composto por quatro algarismos. No primeiro caso de erro na digitação, a pessoa deve esperar 60 segundos para digitar o código novamente. O tempo de espera duplica, em relação ao tempo de espera anterior, a cada digitação errada. Uma pessoa conseguiu ativar o rádio somente na quarta tentativa, sendo de 30 segundos o tempo gasto para digitação do código secreto a cada tentativa. Nos casos da digitação incorreta, ela iniciou a nova tentativa imediatamente após a liberação do sistema de espera.', NULL, NULL, NULL, NULL, NULL, 'Matemática básica', 'O tempo total, em segundo, gasto por essa pessoa para ativar o rádio foi igual a:', 'C', '300', '420', '540', '660', '1020', '2022-01-15 20:29:00');
INSERT INTO `perguntas_matematica` (`id`, `edicaoEnem`, `enunciado`, `imagem`, `texto`, `texto2`, `referencia2`, `referencia`, `conteudo`, `pergunta`, `resposta`, `A`, `B`, `C`, `D`, `E`, `reg_date`) VALUES
(7, 'ENEM 2018 2ª APLICAÇÃO', 'Em um jogo de tabuleiro, a pontuação é marcada com fichas coloridas. Cada ficha vermelha vale um ponto. Três fichas vermelhas podem ser trocadas por uma azul, três fichas azuis podem ser trocadas por uma branca, e três fichas brancas podem ser trocadas por uma verde. Ao final do jogo, os jogadores A, B e C terminaram, cada um, com as quantidades de fichas, conforme a tabela seguinte:', , NULL, NULL, NULL, NULL, 'Matemática básica', 'De acordo com essa tabela, as classificações em primeiro, segundo e terceiro lugares ficaram, respectivamente, para os jogadores: ', 'D', 'A, B e C.', 'B, A e C.', 'C, B e A.', 'B, C e A.', 'C, A e B.', '2022-01-15 20:29:00');
INSERT INTO `perguntas_matematica` (`id`, `edicaoEnem`, `enunciado`, `imagem`, `texto`, `texto2`, `referencia2`, `referencia`, `conteudo`, `pergunta`, `resposta`, `A`, `B`, `C`, `D`, `E`, `reg_date`) VALUES
(8, 'ENEM 2014 1ª APLICAÇÃO', 'Um executivo sempre viaja entre as cidades A e B, que estão localizadas em fusos horários distintos. O tempo de duração da viagem de avião entre as duas cidades é de 6 horas. Ele sempre pega um voo que sai de A às 15h e chega à cidade B às 18h (respectivos horários locais).\r\n\r\nCerto dia, ao chegar à cidade B, soube que precisava estar de volta à cidade A, no máximo, até as 13h do dia seguinte (horário local de A).', NULL, NULL, NULL, NULL, NULL, 'Matemática básica', 'Para que o executivo chegue à cidade A no horário correto e admitindo que não haja atrasos, ele deve pegar um voo saindo da cidade B, em horário local de B, no máximo à(s): ', 'D', '10h', '7h', '1h', '4h', '16h', '2022-01-15 20:29:00'),
(9, 'ENEM 2016 2ª APLICAÇÃO', 'O gerente de um estacionamento, próximo a um grande aeroporto, sabe que um passageiro que utiliza seu carro nos traslados casa-aeroporto-casa gasta cerca de R$10,00 em combustível nesse trajeto. Ele sabe, também, que um passageiro que não utiliza seu carro nos traslados casa-aeroporto-casa gasta cerca de R$80,00 com transporte.\r\n\r\nSuponha que os passageiros que utilizam seus próprios veículos deixem seus carros nesse estacionamento por um período de dois dias.', NULL, NULL, NULL, NULL, NULL, 'Matemática básica', 'Para tornar atrativo a esses passageiros o uso do estacionamento, o valor, em real, cobrado por dia de estacionamento deve ser, no máximo, de: ', 'A', 'R$ 35,00.', 'R$ 40,00.', 'R$ 45,00.', 'R$ 70,00.', 'R$ 90,00.', '2022-01-15 20:29:00'),
(10, 'ENEM 2016 3ª APLICAÇÃO', 'Em um torneio interclasses de um colégio, visando estimular o aumento do número de gols nos jogos de futebol, a comissão organizadora estabeleceu a seguinte forma de contagem de pontos para cada partida: uma vitória vale três pontos, um empate com gols vale dois pontos, um empate sem gols vale um ponto e uma derrota vale zero ponto. Após 12 jogos, um dos times obteve como resultados cinco vitórias e sete empates, dos quais, três sem gols.', NULL, NULL, NULL, NULL, NULL, 'Matemática básica', 'De acordo com esses dados, qual foi o número total de pontos obtidos pelo time citado?', 'C', '22', '25', '26', '29', '36', '2022-01-15 20:29:00');

