INSERT INTO `perguntas_portugues` (`id`, `edicaoEnem`, `enunciado`, `imagem`, `referencia`, `referencia2`, `texto`, `texto2`, `conteudo`, `pergunta`, `resposta`, `A`, `B`, `C`, `D`, `E`, `reg_date`) VALUES
(1, 'ENEM 2019 1° APLICAÇÃO', 'Educação para a saúde mediante\r\nprogramas de educação física escolar', NULL, 'GUEDES, D. P. Motriz, n. 1, 1999', NULL, 'A educação para a saúde deverá ser alcançada mediante interação de ações que possam envolver o próprio homem mediante suas atitudes frente às exigências ambientais representadas pelos hábitos alimentares, estado de estresse, opções de lazer, atividade física, agressões climáticas etc. Dessa forma, parece evidente que o estado de ser saudável não é algo estático. Pelo contrário, torna-se necessário adquiri-lo e construí-lo de forma individualizada constantemente ao longo de toda a vida, apontando para o fato de que saúde é educável e, portanto, deve ser tratada não apenas com base em referenciais de natureza biológica e higienista, mas sobretudo em um contexto didático-pedagógico.', NULL, 'Interpretação de texto', 'A educação para a saúde pressupõe a adoção de comportamentos com base na interação de fatores relacionados à:', 'C', 'a adesão a programas de lazer. ', 'opção por dietas balanceadas.', 'constituição de hábitos saudáveis.', 'evasão de ambientes estressores.', 'realização de atividades físicas regulares.', '2022-01-15 20:51:08'),
(2, 'ENEM 2019 1° APLICAÇÃO', 'O que é software livre', NULL, 'BRANCO, M. Software livre e desenvolvimento social e econômico. In: CASTELLS, M.;\r\nCARDOSO, G. (Org). A sociedade em rede: do conhecimento à ação política. Lisboa:\r\nImprensa Nacional, 2005 (adaptado).', NULL, 'Software livre é qualquer programa de computador construído de forma colaborativa, via internet, por uma comunidade internacional de desenvolvedores independentes. São centenas de milhares de hackers, que negam sua associação com os “violadores de segurança”. Esses desenvolvedores de software se recusam a reconhecer o significado pejorativo do termo e continuam usando a palavra hacker para indicar “alguém que ama programar e que gosta de ser hábil e engenhoso”. Além disso, esses programas são entregues à comunidade com o código fonte aberto e disponível, permitindo que a ideia original possa ser aperfeiçoada e devolvida novamente à comunidade. Nos programas convencionais, o código de programação é secreto e de propriedade da empresa que o desenvolveu, sendo quase impossível decifrar a programação.', 'O que está em jogo é o controle da inovação tecnológica. Software livre é uma questão de liberdade de expressão e não apenas uma relação econômica. Hoje existem milhares de programas alternativos construídos dessa forma e uma comunidade de usuários com milhões de membros no mundo.', 'Interpretação de texto', 'A criação de softwares livres contribui para a produção do conhecimento na sociedade porque: ', 'A', 'democratiza o acesso a produtos construídos coletivamente. \r\n', 'complexifica os sistemas operacionais disponíveis no mercado. ', 'qualifica um maior número de pessoas para o uso de tecnologias.', 'possibilita a coleta de dados confidenciais para seus desenvolvedores. ', 'insere profissionalmente os hackers na área de inovação tecnológica.', '2022-01-15 20:51:08'),
(3, 'ENEM 2019 2º APLICAÇÃO', 'A mídia divulga à exaustão um padrão corporal determinado, padrão único, branco, jovem, musculoso e, especialmente no caso do corpo feminino, magro. Pesquisas apontam para o fato de que esse padrão de beleza divulgado se aplica apenas de 5 a 8% da população mundial. Especialmente no Brasil, onde a diversidade é uma característica marcante, a mídia no geral acaba por mostrar seu desprezo pela riqueza de tipos, de raças, pela própria mestiçagem, insistindo num padrão único de beleza tanto para mulheres quanto para homens.', NULL, 'MALDONADO, G. A educação física e o adolescente: a imagem corporal e a estética da\r\ntransformação na mídia impressa. Revista Mackenzie de Educação Física e Esportes, n. 1, 2006.', NULL, NULL, NULL, 'Interpretação de texto', 'Em relação aos aspectos do padrão corporal dos brasileiros, compreende-se que esta população: ', 'A', 'é caracterizada pela sua rica diversidade.', 'possui, em sua maioria, mulheres obesas.', 'está devidamente representada na grande mídia.', 'tem padrão de beleza idêntico aos demais países.', 'é composta, na maioria, por pessoas brancas e magras.', '2022-01-15 23:57:45'),
(4, 'ENEM 2019 1° APLICAÇÃO', 'Essa lua enlutada, esse desassossego', NULL, 'HILST, H. Júbilo, memória, noviciado da paixão. São Paulo: Cia. Das Letras, 2018.', NULL, 'A convulsão de dentro, ilharga<br>\r\nDentro da solidão, corpo morrendo<br>\r\nTudo isso te devo. E eram tão vastas<br>\r\nAs coisas planejadas, navios,<br>\r\nMuralhas de marfim, palavras largas<br>\r\nConsentimento sempre. E seria dezembro.<br>\r\nUm cavalo de jade sob as águas<br>\r\nDupla transparência, fio suspenso<br>\r\nTodas essas coisas na ponta dos teus dedos<br>\r\nE tudo se desfez no pórtico do tempo<br>\r\nEm lívido silêncio. Umas manhãs de vidro<br>\r\nVento, a alma esvaziada, um sol que não vejo<br>\r\nTambém isso te devo.<br>', NULL, 'Interpretação de texto', 'No poema, o eu lírico faz um inventário de estados passados espelhados no presente. Nesse processo, aflora o: ', 'B', 'cuidado em apagar da memória os restos do amor. ', 'amadurecimento revestido de ironia e desapego. ', 'mosaico de alegrias formado seletivamente. ', 'desejo reprimido convertido em delírio. ', 'arrependimento dos erros cometidos.', '2022-01-17 14:28:33'),
(5, 'ENEM 2015 2ª APLICAÇÃO', '', NULL, 'AMADO, J. Dona Flor e seus dois maridos. São Paulo: Martins, 1966.', 'COUTO, M. Um rio chamado tempo, uma casa chamada terra.', '<b>Texto I</b><br>\r\n\r\nQuem sabe, devido às atividades culinárias da esposa, nesses idílios Vadinho dizia-lhe “Meu manuê de milho verde, meu acarajé cheiroso, minha franguinha gorda”, e tais comparações gastronômicas davam justa ideia de certo encanto sensual e caseiro de dona Flor a esconder-se sob uma natureza tranquila e dócil. Vadinho conhecia-lhe as fraquezas e as expunha ao sol, aquela ânsia controlada de tímida, aquele recatado desejo fazendo-se violência e mesmo incontinência ao libertar-se na cama.<br>\r\n', '<b>Texto II</b>\r\n<br>\r\nAs suas mãos trabalham na braguilha das calças do falecido. Dulcineusa me confessou mais tarde: era assim que o marido gostava de começar as intimidades. Um fazer de conta que era outra coisa, a exemplo do gato que distrai o olhar enquanto segura a presa nas patas. Esse o acordo silencioso que tinham: ele chegava em casa e se queixava que tinha um botão a cair. Calada, Dulcineusa se armava dos apetrechos da costura e se posicionava a jeito dos prazeres e dos afazeres.', 'Interpretação de texto', 'Tema recorrente na obra de Jorge Amado, a figura feminina aparece, no fragmento, retratada de forma semelhante à que se vê no texto do moçambicano Mia Couto. Nesses dois textos, com relação ao universo feminino em seu contexto doméstico, observa-se que:', 'D', 'o desejo sexual é entendido como uma fraqueza moral, incompatível com a mulher casada.', 'a mulher incorpora o sentimento de culpa e age com apatia, como no mito bíblico da serpente.', 'à mulher cabe o poder da sedução, expresso pelos gestos, olhares e silêncios que ensaiam.', 'a mulher tem um comportamento marcado por convenções de papéis sexuais.', 'a dissimulação e a malícia fazem parte do repertório feminino nos espaços público e íntimo.', '2022-01-17 14:30:35'),
(6, 'ENEM 2014 2ª APLICAÇÃO', 'Interfaces', NULL, 'vsites.unb.br. Acesso em: 1 ago. 2012 .', NULL, 'Um dos mais importantes componentes do hipertexto é a sua interface. As interfaces permitem a visualização do conteúdo, determinam o tipo de interação que se estabelece entre as pessoas e a informação, direcionando sua escolha e o acesso ao conteúdo.\r\n\r\nO hipertexto retoma e transforma antigas interfaces da escrita (a noção de interface não deve ser limitada às técnicas de comunicação contemporânea). Constitui-se, na verdade, em uma poderosa rede de interfaces que se conectam a partir de princípios básicos e que permitem uma “interação amigável”. As particularidades do hipertexto virtual, como sua dinamicidade e seus aspectos multimidiáticos, devem-se ao seu suporte ótico, magnético, digital e à sua interface amigável.\r\n\r\nA influência do hipertexto é tanta, que as representações de tipo cartográfico ganham cada vez mais importância nas tecnologias intelectuais de suporte informático. Esta influência também é devida ao fato de a memória humana, segundo estudos da psicologia cognitiva, compreender e reter melhor as informações organizadas, especialmente em diagramas e em mapas conceituais manipuláveis. Por isso, imagina-se que o hipertexto deva favorecer o domínio mais rápido e fácil das informações, em contraponto a um audiovisual tradicional, por exemplo.', 'O texto informa como as interfaces são reaproveitadas pelo hipertexto virtual, influenciando as tecnologias de informação e comunicação.', 'Interpretação de texto', 'De acordo com o texto, qual é a finalidade do uso do hipertexto quanto à absorção e manipulação das informações?', 'E', 'Amparar a pesquisa de mapas e diagramas relacionados à cartografia.', 'Auxiliar os estudos de psicologia cognitiva com base nos hipertextos.', 'Salientar a importância das tecnologias de informação e comunicação.', 'Mesclar antigas interfaces com mecanismos virtuais.', 'Ajudar na apreensão das informações de modo mais eficaz e facilitado.', '2022-01-16 01:27:19'),
(7, 'ENEM 2016 1ª APLICAÇÃO', '', NULL, 'LADEIRA, F. F. Reflexões sobre o consumismo. http://observatoriodaimprensa.com.br.', 'BARCELLOS, G. A alma do consumo. www.diplomatique.org.br. Acesso em: 18 jan. 2015.', '<b>Texto I</b><br>\r\n\r\nNesta época do ano, em que comprar compulsivamente é a principal preocupação de boa parte da população, é imprescindível refletirmos sobre a importância da mídia na propagação de determinados comportamentos que induzem ao consumismo exacerbado. No clássico livro O capital, Karl Marx aponta que no capitalismo os bens materiais, ao serem fetichizados, passam a assumir qualidades que vão além da mera materialidade. As coisas são personificadas e as pessoas são coisificadas. Em outros termos, um automóvel de luxo, uma mansão em um bairro nobre ou a ostentação de objetos de determinadas marcas famosas são alguns dos fatores que conferem maior valorização e visibilidade social a um indivíduo.', '<b>Texto II</b><br>\r\n\r\nTodos os dias, em algum nível, o consumo atinge nossa vida, modifica nossas relações, gera e rege sentimentos, engendra fantasias, aciona comportamentos, faz sofrer, faz gozar. às vezes constrangendo-nos em nossas ações no mundo, humilhando e aprisionando, às vezes ampliando nossa imaginação e nossa capacidade de desejar, consumimos e somos consumidos. Numa época toda codificada como a nossa, o código da alma (o código do ser) virou código do consumidor! Fascínio pelo consumo, fascínio do consumo. <br>Felicidade, luxo, bem-estar, boa forma, lazer, elevação espiritual, saúde, turismo, sexo, família e corpo são hoje reféns da engrenagem do consumo.', 'Interpretação de texto', 'Esses textos propõem uma reflexão crítica sobre o consumismo. Ambos partem do ponto de vista de que esse hábito:', 'B', 'desperta o desejo de ascensão social. \r\n', 'provoca mudanças nos valores sociais. \r\n', 'advém de necessidades suscitadas pela publicidade. \r\n', 'deriva da inerente busca por felicidade pelo ser humano. \r\n', 'resulta de um apelo do mercado em determinadas datas.', '2022-01-17 14:30:35'),
(8, 'ENEM 2013 2ª APLICAÇÃO', 'Concurso de microcontos no Twitter', NULL, 'ELINA, R. www.consuladosocial.com.br. Acesso em: 28 jul. 2010.', NULL, 'A nona edição do Simpósio Internacional de Contadores de História promove concurso de microcontos baseado no Twitter. Os interessados devem ter uma conta no Twitter, seguir o @simposioconta e escrever um microconto de gênero suspense, com tema livre. O conto deve seguir as regras do Twitter: apenas 140 caracteres.', NULL, 'Interpretação de texto', 'Na atualidade, o texto traz uma proposta de utilização do Twitter como ferramenta que proporciona uma construção rápida, sintética e definida pelo gênero suspense. Isso demonstra que essa rede social pode ser uma forma de:', 'B', 'considera que a utilização da escrita com caneta e papel seja primitiva para os dias atuais.', 'define uma dinâmica diferente de construção de texto, condensando as ideias principais sem perder a criatividade\r\n', 'propõe um novo traço à escrita, pois garante a eficiência dos processos de comunicação.', 'caracteriza um texto de tema livre, no qual o número de caracteres importa mais que a criatividade do autor.', 'conceitua uma nova vertente de texto, na qual a rapidez supera o enredo e as outras características do texto.', '2022-01-16 01:35:24');
INSERT INTO `perguntas_portugues` (`id`, `edicaoEnem`, `enunciado`, `imagem`, `referencia`, `referencia2`, `texto`, `texto2`, `conteudo`, `pergunta`, `resposta`, `A`, `B`, `C`, `D`, `E`, `reg_date`) VALUES
(9, 'ENEM 2014 3ª APLICAÇÃO', '', , 'Caco Galhardo, 2001. Disponível em: http://solinguagem.blogspot.com.br. ', NULL, NULL, NULL, 'Interpretação de texto', 'A charge é um gênero textual que tem por finalidade satirizar ou criticar, por meio de uma caricatura, algum fato atual. Assumindo um posicionamento crítico, essa charge retrata:', 'B', 'a intolerância das pessoas frente à mercantilização da televisão.', 'a qualidade dos programas televisivos que são oferecidos à população.', 'o desinteresse do telespectador pela programação oferecida.', 'o caráter agregador do entretenimento televisivo.', 'o contentamento de uma família com seus bens de consumo.', '2022-01-16 01:41:18');
INSERT INTO `perguntas_portugues` (`id`, `edicaoEnem`, `enunciado`, `imagem`, `referencia`, `referencia2`, `texto`, `texto2`, `conteudo`, `pergunta`, `resposta`, `A`, `B`, `C`, `D`, `E`, `reg_date`) VALUES
(10, 'ENEM 2016 3ª APLICAÇÃO', 'A mulher entra no quarto do filho decidida a ter uma conversa séria. De novo, as respostas dele à interpretação do texto na prova sugerem uma grande dificuldade de ler. Dispersão pode ser uma resposta para parte do problema. A extensão do texto pode ser outra, mas nesta ela não vai tocar porque também é professora e não vai lhe dar desculpas para ir mal na escola. Preguiça de ler parece outra forma de lidar com a extensão do texto. Ele está, de novo, no computador, jogando. Levanta os olhos com aquele ar de quem pode jogar e conversar ao mesmo tempo. A mãe lhe pede que interrompa o jogo e ele pede à mãe “só um instante para salvar”. Curiosa, ela olha para a tela e se espanta com o jogo em japonês. Pergunta-lhe como consegue entender o texto para jogar. Ele lhe fala de alguma coisa parecida com uma “lógica de jogo” e sobre algumas tentativas com os ícones. Diz ainda que conhece a base da história e que, assim, mesmo em japonês, tudo faz sentido. Aquela conversa acabou sendo adiada. A mãe-professora não se sentia pronta naquele momento.', NULL, 'BARRETO, R. G. Formação de professores, tecnologias e linguagens: mapeando velhos e novos (des)encontros. São Paulo: Loyola, 2002 (adaptado).', NULL, NULL, NULL, 'Interpretação de texto', 'A reação da mãe-professora frente às habilidades da “geração digital” contemporânea reflete o desafio que se tem enfrentado de:', 'C', 'aplicar as mesmas formas de ler textos impressos a textos digitais.', 'interpretar as várias informações na leitura de textos em multimídia.', 'lidar com as novas práticas de leitura que emergem com a tecnologia.', 'superar as dificuldades de leitura geradas pelos jogos de computadores.', 'trabalhar a dificuldade de leitura usando as tecnologias como ferramentas.', '2022-01-16 01:41:18');

