--
-- Estrutura da tabela `perguntas_quimica`
--

CREATE TABLE `perguntas_quimica` (
  `id` int(6) UNSIGNED NOT NULL,
  `edicaoEnem` varchar(100) NOT NULL,
  `enunciado` text NOT NULL,
  `imagem` longblob DEFAULT NULL,
  `texto` text DEFAULT NULL,
  `texto2` text DEFAULT NULL,
  `referencia2` varchar(200) DEFAULT NULL,
  `referencia` varchar(500) DEFAULT NULL,
  `conteudo` varchar(200) NOT NULL,
  `pergunta` varchar(400) NOT NULL,
  `resposta` varchar(20) NOT NULL,
  `A` varchar(200) NOT NULL,
  `B` varchar(200) NOT NULL,
  `C` varchar(200) NOT NULL,
  `D` varchar(200) NOT NULL,
  `E` varchar(200) NOT NULL,
  `reg_date` timestamp NOT NULL DEFAULT current_timestamp() ON UPDATE current_timestamp()
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;

--
-- Extraindo dados da tabela `perguntas_quimica`
--

INSERT INTO `perguntas_quimica` (`id`, `edicaoEnem`, `enunciado`, `imagem`, `texto`, `texto2`, `referencia2`, `referencia`, `conteudo`, `pergunta`, `resposta`, `A`, `B`, `C`, `D`, `E`, `reg_date`) VALUES
(1, 'ENEM 2016 2ª APLICAÇÃO', 'O principal componente do sal de cozinha é o cloreto de sódio, mas o produto pode ter\r\naluminossilicato de sódio em pequenas concentrações. Esse sal, que é insolúvel em água, age como antiumectante, evitando que o sal de cozinha tenha um aspecto empedrado.', NULL, NULL, NULL, NULL, NULL, 'Química geral e inorgânica', 'O procedimento de laboratório adequado para verificar a presença do antiumectante em uma amostra de sal de cozinha é o(a):', 'C', 'realização do teste de chama.', 'medida do pH de uma solução aquosa.', 'medida da turbidez de uma solução aquosa.', 'ensaio da presença de substâncias orgânicas.', 'verificação da presença de cátions monovalentes.', '2022-01-14 14:57:00'),
(2, 'ENEM 2016 2ª APLICAÇÃO', 'Algumas práticas agrícolas fazem uso de queimadas, apesar de produzirem grandes efeitos negativos. Por exemplo, quando ocorre a queima da palha de cana-de-açúcar, utilizada na produção de etanol, há emissão de poluentes como CO<sub>2</sub>, SO<sub>X</sub>, NO<sub>X</sub> e materiais particulados (MP) para a atmosfera. Assim, a produção de biocombustíveis pode, muitas vezes, ser acompanhada da emissão de vários poluentes.', NULL, NULL, NULL, NULL, 'CARDOSO, A. A.; MACHADO, C. M. D.; PEREIRA, E. A. Biocombustível: o mito do\r\ncombustível limpo. Química Nova na Escola, n. 28, maio 2008 (adaptado).', 'Química geral e inorgânica', 'Considerando a obtenção e o consumo desse biocombustível, há transformação química quando:', 'C', 'o etanol é armazenado em tanques de aço inoxidável.', 'a palha de cana-de-açúcar é exposta ao sol para secagem.', 'a palha da cana e o etanol são usados como fonte de energia.', 'os poluentes SO<sub>X</sub>, NO<sub>X</sub> e MP são mantidos intactos e dispersos\r\nna atmosfera.', 'os materiais particulados (MP) são espalhados no ar e sofrem\r\ndeposição seca.', '2022-01-14 14:57:00');
INSERT INTO `perguntas_quimica` (`id`, `edicaoEnem`, `enunciado`, `imagem`, `texto`, `texto2`, `referencia2`, `referencia`, `conteudo`, `pergunta`, `resposta`, `A`, `B`, `C`, `D`, `E`, `reg_date`) VALUES
(3, 'ENEM 2016 3ª APLICAÇÃO', 'Combustíveis automotivos têm sido adulterados pela adição de substâncias ou materiais de baixo valor comercial. Esse tipo de contravenção pode danificar os motores, aumentar o consumo de combustível e prejudicar o meio ambiente. Vários testes laboratoriais podem ser utilizados para identificar se um combustível está ou não adulterado. A legislação brasileira estabelece que o diesel, obtido do petróleo, contenha certa quantidade de biodiesel. O quadro apresenta valores de quatro propriedades do diesel, do biodiesel e do óleo vegetal, um material comumente utilizado como adulterante.', , NULL, NULL, NULL, NULL, 'Química geral e inorgânica', 'Com base nas informações apresentadas no quadro, quais são as duas propriedades que podem ser empregadas tecnicamente para verificar se uma amostra de diesel comercial está ou não adulterada com óleo vegetal?', 'A', 'Densidade e viscosidade.', 'Teor de enxofre e densidade.', 'Viscosidade e teor de enxofre.', 'Viscosidade e poder calorífico.', 'Poder calorífico e teor de enxofre.', '2022-01-14 15:34:39');
INSERT INTO `perguntas_quimica` (`id`, `edicaoEnem`, `enunciado`, `imagem`, `texto`, `texto2`, `referencia2`, `referencia`, `conteudo`, `pergunta`, `resposta`, `A`, `B`, `C`, `D`, `E`, `reg_date`) VALUES
(4, 'ENEM 2017 1ª APLICAÇÃO', 'Na Idade Média, para elaborar preparados a partir de plantas produtoras de óleos essenciais, as coletas das espécies eram realizadas ao raiar do dia. Naquela época, essa prática era fundamentada misticamente pelo efeito mágico dos raios lunares, que seria anulado pela emissão dos raios solares. Com a evolução da ciência, foi comprovado que a coleta de algumas espécies ao raiar do dia garante a obtenção de material com maiores quantidades de óleos essenciais.', NULL, NULL, NULL, NULL, NULL, 'Química geral e inorgânica', 'A explicação científica que justifica essa prática se baseia na:', 'A', 'volatilização das substâncias de interesse.', 'polimerização dos óleos catalisada pela radiação solar.', 'solubilização das substâncias de interesse pelo orvalho.', 'oxidação do óleo pelo oxigênio produzido na fotossíntese.', 'liberação das moléculas de óleo durante o processo de fotossíntese.', '2022-01-14 15:03:52'),
(5, 'ENEM 2011 1ª APLICAÇÃO', 'Belém é cercada por 39 ilhas, e suas populações convivem com ameaças de doenças. O motivo, apontado por especialistas, é a poluição da água do rio, principal fonte de sobrevivência dos ribeirinhos. A diarreia é frequente nas crianças e ocorre como consequência da falta de saneamento básico, já que a população não tem acesso à água de boa qualidade. Como não há água potável, a alternativa é consumir a do rio.', NULL, NULL, NULL, NULL, 'O Liberal. 8 jul. 2008. http://www.oliberal.com.br.', 'Química geral e inorgânica', 'O procedimento adequado para tratar a água dos rios, a fim de atenuar os problemas de saúde causados por microrganismos a essas populações ribeirinhas é a:', 'B', 'coagulação.', 'cloração.', 'decantação.', 'filtração.', 'fluoretação.', '2022-01-14 15:16:41');
INSERT INTO `perguntas_quimica` (`id`, `edicaoEnem`, `enunciado`, `imagem`, `texto`, `texto2`, `referencia2`, `referencia`, `conteudo`, `pergunta`, `resposta`, `A`, `B`, `C`, `D`, `E`, `reg_date`) VALUES
(6, 'ENEM 2017 LIBRAS', 'A figura representa a sequência de etapas em uma estação de tratamento de água.', , NULL, NULL, NULL, 'www.ecoguia.cm-mirandela.pt. Acesso em: 30 jul. 2012.', 'Química geral e inorgânica', 'Qual etapa desse processo tem a densidade das partículas como\r\nfator determinante?', 'C', 'Oxidação.', 'Floculação.', 'Decantação.', 'Filtração.', 'Armazenamento.', '2022-01-14 15:16:41');
INSERT INTO `perguntas_quimica` (`id`, `edicaoEnem`, `enunciado`, `imagem`, `texto`, `texto2`, `referencia2`, `referencia`, `conteudo`, `pergunta`, `resposta`, `A`, `B`, `C`, `D`, `E`, `reg_date`) VALUES
(7, 'ENEM 2019 1ª APLICAÇÃO', 'Por terem camada de valência completa, alta energia de ionização e afinidade eletrônica praticamente nula, considerou-se por muito tempo que os gases nobres não formariam compostos químicos. Porém, em 1962, foi realizada com sucesso a reação entre o xenônio (camada de valência 5s<sup>2</sup>5p<sup>6</sup>) e o hexafluoreto de platina e, desde então, mais compostos novos de gases nobres vêm sendo sintetizados. Tais compostos demonstram que não se pode aceitar acriticamente a regra do octeto, na qual se considera que, numa ligação química, os átomos tendem a adquirir estabilidade assumindo a configuração eletrônica de gás nobre. Dentre os compostos conhecidos, um dos mais estáveis é o difluoreto de xenônio, no qual dois átomos do halogênio flúor (camada de valência 2s<sup>2</sup>2p<sup>5</sup>) se ligam covalentemente ao átomo de gás nobre para ficarem com oito elétrons de valência.', NULL, NULL, NULL, NULL, NULL, 'Química geral e inorgânica', 'Ao se escrever a fórmula de Lewis do composto de xenônio citado, quantos elétrons na camada de valência haverá no átomo do gás nobre?', 'C', '6', '8', '10', '12', '14', '2022-01-20 22:02:47'),
(8, 'ENEM 2012 1ª APLICAÇÃO', 'Os tubos de PVC, material organoclorado sintético, são normalmente utilizados como encanamento na construção civil. Ao final da sua vida útil, uma das formas de descarte desses tubos pode ser a incineração. Nesse processo libera-se HCl (g), cloreto de hidrogênio, dentre outras substâncias. Assim, é necessário um tratamento para evitar o problema da emissão desse poluente.', NULL, NULL, NULL, NULL, NULL, 'Química geral e inorgânica', 'Entre as alternativas possíveis para o tratamento, é apropriado canalizar e borbulhar os gases provenientes da incineração em:', 'A', 'água de cal.', 'água destilada.', 'água desmineralizada.', 'água salobra.', 'água dura.', '2022-01-14 15:27:59'),
(9, 'ENEM 2013 2ª APLICAÇÃO', 'O mármore é um material empregado para revestimento de pisos e um de seus principais constituintes é o carbonato de cálcio. Na limpeza desses pisos com solução ácida, ocorre efervescência.', NULL, NULL, NULL, NULL, NULL, 'Química geral e inorgânica', 'Nessa efervescência o gás liberado é o:', 'D', 'hidrogênio.', 'cloro.', 'monóxido de carbono.', 'dióxido de carbono.', 'oxigênio.', '2022-01-14 15:33:56');
INSERT INTO `perguntas_quimica` (`id`, `edicaoEnem`, `enunciado`, `imagem`, `texto`, `texto2`, `referencia2`, `referencia`, `conteudo`, `pergunta`, `resposta`, `A`, `B`, `C`, `D`, `E`, `reg_date`) VALUES
(10, 'ENEM 2019 2ª APLICAÇÃO', 'Laboratórios de química geram como subprodutos substâncias ou misturas que, quando não têm mais utilidade nesses locais, são consideradas resíduos químicos. Para o descarte na rede de esgoto, o resíduo deve ser neutro, livre de solventes inflamáveis e elementos tóxicos como Pb, Cr e Hg. Uma possibilidade é fazer uma mistura de dois resíduos para obter um material que apresente as características necessárias para o descarte. Considere que um laboratório disponha de frascos de volumes iguais cheios dos resíduos, listados no quadro.', , NULL, NULL, NULL, NULL, 'Química geral e inorgânica', 'Qual combinação de resíduos poderá ser descartada na rede de esgotos?', 'C', 'I e II', 'II e III', 'II e IV', 'V e VI', 'IV e VI', '2022-01-14 15:33:56');

