--

CREATE TABLE `temas_redacao` (
  `id` int(11) NOT NULL,
  `tema` varchar(500) NOT NULL,
  `textos_motivadores` text NOT NULL,
  `imagem` mediumblob NOT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;

--
-- Extraindo dados da tabela `temas_redacao`
--

INSERT INTO `temas_redacao` (`id`, `tema`, `textos_motivadores`, `imagem`) VALUES
(1, 'A EDUCAÇÃO ENQUANTO AGENTE DE TRANSFORMAÇÃO SOCIAL', ' <p>\"A Educação, direito de todos e dever do Estado e da família será promovida e incentivada com a colaboração da sociedade visando ao pleno desenvolvimento da pessoa, seu preparo para o exercício da cidadania e sua qualificação para o trabalho.\" (CFB/88 art. 205)<br></p>\n\n<a>http://www.senado.leg.br/atividade/const/con1988/CON1988_05.10.1988/art_205_.asp</a><br>\n<p>\n   “Sei que o ensino não é a alavanca para a mudança ou transformação da sociedade, mas sei que a transformação social é feita de muitas tarefas pequenas e grandes, grandiosas e humildes! Estou incumbindo de uma dessas tarefas. Sou um humilde agente da tarefa global de transformação. Muito bem, descubro isso, proclamo isso, verbalizo minha opção” — Paulo Freire, educador, pedagogo e filósofo brasileiro.<br>\n</p>\n  <p> No contexto atual, o desafio da educação e transformação social é estimular, nas circunstâncias mais diferentes, a capacidade de intervenção e transformação na perspectiva social de emancipação humana contemplando a diversidade cultural.<br></p>\n<p>\n   A educação como transformação social não é tão fácil de ser instituída, pois a educação não é por si só um fator determinante de transformação. No entanto, mesmo diante de todos os limites, ela vem ocorrendo a partir de diferentes formas de luta e manifestações de sujeitos sociais nos diferentes lugares, sentidos, povos, culturas em defesa um mundo mais justo e que em um estado de direito todos possam exercer e gozar de sua cidadania. O que se busca, é tornar o político pedagógico, utilizar práticas que incorporem interesses transformadores, problematizando o conhecimento, utilizando o diálogo crítico e afirmativo, enfim “argumentando em prol de um mundo qualitativamente melhor para todas as pessoas”.<br>\n</p>\n<a>https://www.recantodasletras.com.br/artigos/2143223</a><br>\n<p>\n   Concluir que a escola está, e sempre esteve, ligada à sociedade e a seus constituintes, é o que nos permite acreditar que mudar a escola pode, de alguma forma, influenciar na situação social.<br>\n</p><p>\n   Fala-se em fracasso da escola, por exemplo, ao constatar-se que os indivíduos, depois de muitos anos dentro do sistema de ensino, sabem muito pouco sobre o que lhes foi ensinado.<br>\n</p>\n  <p> Para a professora Ida Regina Mendonça, a sociedade contemporânea ainda exige que a escola tenha como meta a preparação do aluno para o mercado de trabalho. Dessa forma, o desenvolvimento de ideias, conhecimentos, habilidades e comportamentos, têm de estar em consonância com as exigências da coletividade capitalista que considera a propriedade e não o indivíduo como cidadão. Mas a professora afirma que nos últimos anos há um movimento de mudança e de transformação do papel da escola, que está contrariando as concepções conservadoras impostas pela sociedade.<br>\n</p>\n  <p> A escola é um sistema composto de regras sociais condicionantes e de agentes sociais que atuam em tal campo. Logo, para uma efetiva ação transformadora, também se faz necessário refletirmos sobre as formas de agir do professor no contexto das suas práticas pedagógicas.<br>\n</p>\n<a>http://culturadetravesseiro.blogspot.com.br/2010/12/educacao-como-transformacao-da.html</a><br>\n\n  <p> A educação para ser transformadora precisa colaborar para a formação de cidadãos conscientes, responsáveis e atuantes na sociedade. É papel da escola, por exemplo, inserir os alunos em ações que possam melhorar a vida da comunidade no entorno das instituições de ensino. Ou mesmo motivá-los a trabalhar em prol do coletivo e de boas causas.<br>\n</p>\n  <p> Por estar inserida em uma comunidade, a escola pode criar espaços de discussão com seus professores e alunos sobre diversos temas, como meio ambiente, paz, família, diversidade cultural, conflitos e outras demandas locais. Professores e alunos podem – e devem – buscar soluções, expor opiniões e planejar juntos ações para melhorar o mundo que os cerca. A Lei de Diretrizes e Bases da Educação Nacional (LDB), inclusive, reconhece a importância desses valores na educação escolar. A educação é também a formação da cidadania, é apoiar os estudantes a se desenvolverem como seres humanos.<br>\n</p>\n<a>http://www.gazetadopovo.com.br/blogs/giro-sustentavel/a-escola-e-a-educacao-transformadora/</a><br>\n<p>\n   A Educação Popular é uma educação comprometida e participativa orientada pela perspectiva de realização de todos os direitos do povo. Não é uma educação fria e imposta, pois baseia-se no saber da comunidade e incentiva o diálogo. Não é “Educação Informal” porque visa a formação de sujeitos com conhecimento e consciência cidadã e a organização do trabalho político para afirmação do sujeito. É uma estratégia de construção da participação popular para o redirecionamento da vida social. A principal característica da Educação Popular é utilizar o saber da comunidade como matéria prima para o ensino. É aprender a partir do conhecimento do sujeito e ensinar a partir de palavras e temas geradores do cotidiano dele. A Educação é vista como ato de conhecimento e transformação social.<br>\n</p>\n<a>https://jornalggn.com.br/blog/luisnassif/a-educacao-como-agente-social-de-transformacao</a>', );
INSERT INTO `temas_redacao` (`id`, `tema`, `textos_motivadores`, `imagem`) VALUES
(2, 'A DIFICULDADE DO JOVEM DIANTE DA ESCOLHA PROFISSIONAL', '<h4>TEXTO I</h4>\n<br>\n<p>Ser ou não ser: a escolha da profissão na adolescência</p><br>\n<p>Por Jô Alvim, publicado em Psicoblobg, em 14 mar. 2017</p><br>\n<p>\nPedagogia? Enfermagem? Direito? Biologia? Jornalismo? Medicina?  Qual destas profissões é a melhor pra mim? Qual delas dá mais dinheiro?  E se eu escolher errado? Estas são algumas das indagações – repleta de aflições- dos adolescentes quando se deparam com a necessidade de fazer uma escolha profissional. É visível o despreparo e desconhecimento deles quanto às profissões e o mercado de trabalho.  Soma-se a este quadro a pressão exercida de uma sociedade globalizada que determina respostas rápidas nos ambientes e pessoas. [...]</p><br>\n\n<p>\nDiante da angústia em ter que decidir o que vai ser “para o resto da vida”, alguns adolescentes realizam as escolhas baseadas em estereótipos ou representações distorcidas da profissão. Há aqueles que reagem inversamente, demonstrando bastante tranquilidade, que nada mais é do que uma defesa contra aquilo que lhe causa tanta angústia. Soma-se a isso o relato de alguns que dizem que a família não participa da escolha sob o discurso de “não querer interferir”, denotando a dificuldade dos pais em suportar a ansiedade deste período.</p><br>\n\n<p>\nAs influências da família, da mídia e do sistema de valores social, cultural e econômico se fazem presentes e algumas delas são relevantes na decisão do adolescente. Muitas escolhas, por exemplo, são pautadas apenas pelo retorno financeiro, deixando de lado as gratificações emocionais. Outros, diante de tantas dúvidas, optam por seguir a carreira de um dos pais ou atender as expectativas deles, fruto de sonhos não realizados. O jovem, diante de tantos conflitos, tem medo de errar ou de decepcionar os pais e por isso acaba atendendo as sugestões familiares sem uma avaliação realística da mesma.</p><br>\n\n<a>Disponível em: http://g1.globo.com/sp/presidente-prudente-regiao/blog/psicoblog/post/ser-ou-nao-ser-escolha-da-profissao-na-adolescencia.html. Acesso: 27 ago. 2020.</a><br>\n\n\n\n<h4>TEXTO II</h4><br>', );
INSERT INTO `temas_redacao` (`id`, `tema`, `textos_motivadores`, `imagem`) VALUES
(3, 'A IMPORTÂNCIA DA EDUCAÇÃO FINANCEIRA NA VIDA DOS CIDADÃOS BRASILEIROS\r\n', '<h4>TEXTO I</h4><br>\r\n\r\n<p>Entrevista com o humorista João Cláudio Moreno</p><br>\r\n\r\n<p>Para Emílio Surita, Jovem Pan FM, em 06 jun. 2018</p><br>\r\n\r\n<p>Eu pedi R$ 5 mil emprestados a minha mãe, ela me deu. Então, perguntei: Mas mãe, como a Senhora tem esse dinheiro para me emprestar se é aposentada com um salário-mínimo?!! Então ela me respondeu: “Meu filho, o segredo não é quanto se ganha, mas quanto se gasta!”\r\n</p><br>\r\n<a>Disponível em: https://www.youtube.com/watch?v=uo2OM-PaqSA. Acesso em: 13 jul. 2021.</a><br>\r\n\r\n\r\n\r\n<h4>TEXTO II</h4><br>\r\n\r\n<p>A importância da Educação Financeira na vida do cidadão</p><br>\r\n<p>\r\nPor Antônio Chaves, publicado em 12 ago. 2020.</p><br>\r\n<p>\r\nPodemos perceber que, mesmo com a lenta recuperação econômica, as famílias ainda enfrentam dificuldades para honrar seus compromissos em dia. O brasileiro ainda não aprendeu a gerenciar melhor as suas finanças. Toda escola brasileira deveria tratar de educação financeira na Educação Infantil e no Ensino Fundamental.  Deve ser conduzido de forma que envolva outras disciplinas para além da matemática. O Desenvolvimento Econômico mostra que mais da metade dos jovens brasileiros não tem conhecimentos básicos sobre como lidar com dinheiro. Os jovens brasileiros chegam à fase adulta com grande risco de ficar inadimplentes.<br>\r\n</p>\r\n<a>Disponível em: https://pensarbemviverbem.com.br/a-importancia-da-educacao-financeira-na-vida-do-cidadao/. Acesso: 13 jul. 2021. (adaptado)</a><br>\r\n\r\n<h4>TEXTO III</h4><br>\r\n<p>\r\nEducação Financeira – qual a importância de saber sobre finanças</p><br>\r\n\r\n<p>Por PRAVALER, publicado em 06 nov. 2020</p>\r\n<br>\r\n<p>\r\n Com certeza você já buscou práticas e ferramentas que te ajudem a economizar e organizar as finanças, não é mesmo?! Controlar os gastos, poupar dinheiro ou até mesmo investir em ações ou fundos imobiliários podem ser ótimas alternativas, mas, sem uma educação financeira, elas também se tornam um grande obstáculo para uma vida financeira saudável. Educação financeira é muito mais do que juntar os ganhos e apertar os cintos. E aqui, neste artigo, vamos lhe explicar como criar esse hábito na sua vida e fazer um bom uso do seu tão suado dinheiro. A educação financeira nada mais é do que a maneira como uma pessoa entende o universo do dinheiro e usa as ferramentas possíveis para lidar com ele. Perceba que isso vai além do simples ato de economizar, pois diz respeito também à consciência a respeito de oportunidades e riscos envolvendo esse tema. Na prática, a importância da educação financeira é dar condições para uma pessoa decidir melhor o que fazer com seu dinheiro. É nesse ponto que surgem as estratégias: quanto dinheiro poupar? Onde investir? Ter maior rentabilidade, liquidez ou segurança? Enfim, todas essas perguntas podem ser facilmente respondidas se você tem ao seu lado a educação financeira.</p><br>\r\n\r\n<a>Disponível em: https://www.pravaler.com.br/educacao-financeira-qual-a-importancia-de-saber-sobre-financas/. Acesso: 13 jul. 2021. (adaptado)</a>\r\n<br>\r\n\r\n\r\n<h4>TEXTO IV</h4><br>', );
INSERT INTO `temas_redacao` (`id`, `tema`, `textos_motivadores`, `imagem`) VALUES
(4, 'DESAFIOS PARA A DIVULGAÇÃO CIENTÍFICA NO BRASIL', '<h4>TEXTO I</h4>\r\n<br><p>\r\nA difícil tarefa de divulgar ciência no Brasil</p><br>\r\n<p>\r\nMuito se fala de como é difícil fazer ciência no Brasil (é difícil mesmo, podem acreditar), mas algo que talvez represente um desafio ainda maior é divulgar a ciência ao grande público. Os grandes institutos na Europa e nos Estados Unidos contam com uma equipe dedicada. Jornalistas e designers contratados exclusivamente para criar o material de divulgação conversam com os pesquisadores e produzem as notícias, os vídeos, os gráficos que aparecem nos jornais [...]. Aqui no Brasil, a coisa é muito mais complicada. Não temos verbas para um departamento de comunicação. Com poucas exceções, universidades contratam um jornalista para atender uma comunidade de 100.000 pessoas, o que é insuficiente. O resultado? Cadernos de ciência de todo o país recebem uma enxurrada de notícias internacionais, e astrônomos norte-americanos ganham mais espaço na imprensa brasileira que os próprios brasileiros. Acreditem: temos ciência de ponta no Brasil [...]. A população só vai entender a importância dos investimentos em ciência quando conhecer a pesquisa que se faz por aqui — e só conhecerá a ciência brasileira quando houver uma estratégia de comunicação apropriada. Para justificar o investimento em pesquisa, é preciso explicar os seus benefícios a quem paga os impostos. Ou então podemos esperar o inverso: a população desconhece a ciência nacional, o que serve de desculpa para políticos deixarem de investir em pesquisa, em um círculo vicioso de atraso científico.</p><br>\r\n\r\n<a>Disponível em: <https://ultimosegundo.ig.com.br/colunas/astronoticias/2019-02-20/divulgacao-cientifica-no-brasil.html>. Acesso em: 04 nov. 2021 (adaptado). </a>\r\n<br>\r\n\r\n\r\n<h4>TEXTO II</h4>\r\n<br><p>\r\nApesar de a internet ter colaborado muito para o acesso à informação, a maioria das pesquisas e descobertas científicas circula principalmente na academia científica, nas universidades e nos centros de pesquisa, sendo consumida pelos próprios pesquisadores, por autodidatas e alguns curiosos. A não ser que ocorra um grande surto de determinada doença (como o caso da Ebola e da Zyka) ou que a pesquisa tenha algum tipo de impacto diretamente na economia, as notícias e os conhecimentos gerados pela ciência ficam retidos em grupos específicos da sociedade.<p><br>\r\n\r\n<a>Disponível em: <http://www.cienciaexplica.com.br/2017/07/31/importancia-da-divulgacao-cientifica/>. Acesso em: 04 nov. 2021 (adaptado).</a>\r\n<br>\r\n<h4>TEXTO III</h4>\r\n<br><p>\r\nA ciência e os cientistas precisam ir até onde os jovens estão. Esse é um passo essencial para melhorar a divulgação científica no país e estimular os estudantes a abraçarem a carreira de pesquisa. O físico e astrônomo Marcelo Gleiser sugeriu, no Senado, que se passe a exigir que alunos de graduação e pós-graduação dediquem um determinado número de horas por mês para participação em eventos em escolas públicas, para que falem aos estudantes sobre como é a vida do cientista. “É importante desmistificar a carreira do cientista. Nenhum cientista vai às escolas para falar o que é ciência, por que é cientista. Então, as crianças não têm a menor ideia do que é ser cientista. Eles sabem o que é ser engenheiro, mas cientista é uma incógnita”, lamentou o professor [...]. “Está faltando a popularização da ciência. As pessoas têm que saber o que os cientistas estão fazendo. Canso de receber a mesma pergunta: onde estão os cientistas, que ninguém os conhece? O que estão fazendo? Quais as suas descobertas? Quais os seus projetos de pesquisa?”, lamenta Gleiser, possivelmente o mais conhecido cientista do país, graças à série Poeira das Estrelas, que apresentou no Fantástico, da TV Globo, na década passada. “Trabalhei seis anos no Globo Ciência, na TV Globo, que vai ao ar às 6h30 da manhã, no sábado. Qual o adolescente que acorda 6h30 no sábado? Com as séries do Fantástico que foram feitas, a mesma coisa. Deveriam ser muitas, mas acabaram sendo poucas, porque tiveram que nivelar por baixo”, recorda o cientista.</p>\r\n<br>\r\n<h4>TEXTO IV</h4><br>', );

